function qqLogin() {
    need('biz.login', function (LoginManager) {
        LoginManager.checkLogin(function (userinfo) {
            toShare();
            qqHandle();
            selectRole();
            globalInfo.user.isLogin = true;
            globalInfo.user.nickName = decodeURIComponent(userinfo.nickName) == '' ? LoginManager.getUserUin() : decodeURIComponent(userinfo.nickName);
            globalInfo.user.icon = "https://q3.qlogo.cn/headimg_dl?bs=uin&dst_uin=" + LoginManager.getUserUin() + "&spec=100&url_enc=0&referer=bu_interface&term_type=PC";

            // 初始化显示
            globalInfo.user.iPlatId = isIOS() ? 0 : 1;
            globalInfo.user.iAreaId = 2;
            globalInfo.user.isH5 = true;
            var userAgents = window.navigator.userAgent.toLowerCase().split('/');
            // alert(window.navigator.userAgent);
            $.each(userAgents, function (k, v) {
                if ((isAndroid() && /^[0-9].[0-9].[0-9]/.test(v) && /nettype/.test(v)) || (isIOS() && /^[0-9].[0-9].[0-9]/.test(v) && /_/.test(v))) {
                    // alert(v);
                    if (v < '8') {
                        globalInfo.public.isArk = false;
                    }
                    return false;
                }
            });
            $(".btn-xyyx,.btn-xyyx2").hide();//隐藏炫耀按钮
            globalInfo.user.client = 'qq';
            gpSubmit(316510,682955);//初始化
        }, function () {
            LoginManager.login();
        });
    });
}
function logOut() {
    need('biz.login', function (LoginManager) {
        LoginManager.checkLogin(function (userinfo) {
            LoginManager.logout();
            // 初始化显示
            globalInfo.user.iPlatId = isIOS() ? 0 : 1;
            globalInfo.user.iAreaId = 2;
            globalInfo.user.isH5 = true;
            var userAgents = window.navigator.userAgent.toLowerCase().split('/');
            $.each(userAgents, function (k, v) {
                if ((isAndroid() && /^[0-9].[0-9].[0-9]/.test(v) && /nettype/.test(v)) || (isIOS() && /^[0-9].[0-9].[0-9]/.test(v) && /_/.test(v))) {
                    // alert(v);
                    if (v < '8') {
                        globalInfo.public.isArk = false;
                    }
                    return false;
                }
            });
            globalInfo.user.client = 'qq';
        }, function () {
            LoginManager.logout();
        });
    });
}


/**
 * 微信登录处理
 */
function wxLogin()
{
    var shareCode = milo.request('shareCode');
    if(shareCode != ''){
        var activityUrl = location.protocol+'//gp.qq.com/cp/a20200709yqhz/index.html?acctype=wx&appid=wx1cd4fbe9335888fe&shareCode='+shareCode;
    }else{
        var activityUrl = location.protocol+'//gp.qq.com/cp/a20200709yqhz/index.html?acctype=wx&appid=wx1cd4fbe9335888fe';
    }

    need("biz.login",function(LoginManager){
        LoginManager.init({
            appConfig:{
                avoidConflict: true,		//默认值为空，判断是否需要校验微信登录态串号，设为true，为必须校验，设为false，为不校验，默认值""表示在微信环境下校验，其它app环境下不校验
                WxAppId: 'wx1cd4fbe9335888fe',  //拉起微信授权的业务APPID，根据实际情况修改（如果是直接用游戏的APPID，则此处修改为游戏的APPID）
                scope: "snsapi_userinfo"   	//默认是 snsapi_base 静默授权，如果游戏无静默权限，就需要手动改成 snsapi_userinfo
            }
        });
        LoginManager.checkLogin(function (userinfo) {
                var acctype = milo.cookie.get('acctype');
                //判断客户端与当前登录方式是否一致，不一致注销登录态信息，刷新页面
                if ((isWeiXin() && acctype != 'wx') || (isQQ() && acctype == 'wx')) {
                    LoginManager.logout({
                        logoutCallback:function() {
                            location.reload(true);
                        }
                    });
                    return;
                } else {
                    selectRole();
                    globalInfo.user.isLogin = true;
                    globalInfo.user.isH5 = true;
                    globalInfo.user.iPlatId = isIOS() ? 0 : 1;
                    globalInfo.user.iAreaId = 1;
                    globalInfo.user.client = 'wx';
                    acctypes = 'weixin';
                    // $("#mxCard a").removeClass().addClass("icons btn-lq2 btn-scale t");//领取
                    // TGDialogS('pop36');
                    //微信登录
                    var openid = milo.cookie.get('openid');
                    var access_token = milo.cookie.get('access_token');

                    LoginManager.getUserInfoByWxOpenId({
                        "openid": openid,
                        'access_token': access_token
                    }, function (data) {
                        globalInfo.user.nickName = delHtmlTag(encodeURIComponent(data.nickname));//获取到的微信昵称
                        if (data.headimgurl == '') {
                            globalInfo.user.icon = '';
                        } else {
                            globalInfo.user.icon = encodeURIComponent(data.headimgurl) + "/96";//头像
                        }
                        $(".btn-xyyx,.btn-xyyx2").hide();//隐藏炫耀按钮
                        toShare();
                        wxHandle();//wx特殊处理
                        gpSubmit(316510,682955);//初始化
                    });

                }
            },
            function(){
                LoginManager.loginByWX({
                    redirect_wx_url: location.protocol + "//iu.qq.com/wxauth/redirect.html?url=" + encodeURIComponent(activityUrl)//回调url
                });
            },{
                appConfig: {
                    WxAppId : 'wx1cd4fbe9335888fe', //腾讯游戏活动号appid
                    scope : 'snsapi_userinfo'  //snsapi_base获取用户openid信息，snsapi_userinfo可以获取到图像，昵称 等等信息
                }
            }
        );
    });
}

