//是否在指定日期内
function isInTime(nowYear,nowMonth,nowDay){
    var myDate = new Date();
    var myYear = myDate.getFullYear();//获取年
    var myMonth = myDate.getMonth() + 1;//获取月
    var myDay = myDate.getDate();//获取日

    if(myYear == nowYear && myMonth >=nowMonth && myDay >= nowDay ){
        return true;
    }else{
        return false;
    }
}
//是否在指定日期时间内
function isInActTime(nowYear,nowMonth,nowDay,nowHours){
    var myDate = new Date();
    var myYear = myDate.getFullYear();//获取年
    var myMonth = myDate.getMonth() + 1;//获取月
    var myDay = myDate.getDate();//获取日
    var myHours = myDate.getHours();//获取小时

    if(myYear == nowYear && myMonth >=nowMonth && myDay >= nowDay && myHours){
        return true;
    }else{
        return false;
    }
}
function showTime(time) {
    time = getDateDiff(time);
    var data = new Date(time);
    var year = data.getFullYear();  //获取年
    var month = data.getMonth() + 1;    //获取月
    var day = data.getDate(); //获取日
    var hours = data.getHours();
    var minutes = data.getMinutes();
    var seconds = data.getSeconds();
    // return year + "-" + month + "-" + appendZero(day) + " " + appendZero(hours) + ':' + appendZero(minutes);
    return month + "-" + appendZero(day) + " " + appendZero(hours) + ':' + appendZero(minutes);
//     if (isShow == 1) {
//         return month + "月" + day + "日";
//     } else {
// //  	return hours + ':' + minutes + ':'+seconds;
//         return hours + ':' + minutes;
//     }
}

function getDateDiff(time) {
    var time = time.replace(/\-/g, "/");
    return time;
}
function appendZero(obj) {
    if (obj < 10) return "0" + "" + obj;
    else return obj;
}


