function delHtmlTag(str){
    return str.replace(/<[^>]+>/g,"");
}



/**
 * 数组随机排序
 * @param arr
 * @returns {*}
 */
function shuffle(arr) {
    var len = arr.length;
    for (var i = 0; i < len - 1; i++) {
        var index = parseInt(Math.random() * (len - i));
        var temp = arr[index];
        arr[index] = arr[len - i - 1];
        arr[len - i - 1] = temp;
    }
    return arr;
}

